import React from 'react'
import ReactDom from "react-dom"

class Test  extends React.Component{




    render() {
        return(<div><TableHead/><TableData/></div>)
    }

}

class TableData extends React.Component{



    constructor(){
        super()
        this.state={
             updateView:function(val){
                 return this.item=val;

             },
            item:"Date",
            data:[]
         }
         this.setStateHandler=this.setStateHandler.bind(this);


    }

    setStateHandler() {

            this.state.data.slice().state.data.push(document.getElementById("test_state").value);
            for(let x of this.state.data){
                this.state.updateView(x);
            }

            this.setState({data:this.state.data})

         }
        render() {
            return (<div><input id="test_state" type="text"/> <input type="button" value="State" onClick={this.setStateHandler}/>

                <div>{this.state.item}</div>
            </div>);


        }

}
TableData.defaultProps={

    tool:"Dagger",
    vehicle:"Amore"
}


class TableHead extends React.Component{

    render() {
        return(<div><tbody><tr><th>Head</th><th>Nose</th></tr></tbody></div>);
    }

}
class Heading extends React.Component{

    render() {
        return(<div>Movie Vegas</div>);
    }

}


export default TableData;
